import constant from "./constants/constant";
import auth from "./utils/authentication";
function getName () {
  let authObject = new auth()
  let user = JSON.parse(authObject.getUserInfo());
  if(!user) {
    return ''
  }
}
export default {
  items: [
    {
      title: true,
      name: localStorage.getItem("name"),
      wrapper: {
        element: '',
        attributes: {},
      },
    },
    {
      name: 'Dashboard',
      // url: '/dashboard',
      icon: 'icon-pie-chart',
    },

    {
      name: 'Airport',
      url: '/manageairport',
